    false,nt"url": null,nt"notes": "NCEI Accession 0155654 includes physical
    and underway data collected aboard the ROGER REVELLE during cruise KNOX05RR in the
    Andaman Sea or Burma Sea, Bay of Bengal and Indian Ocean from 2007-05-07 to 2007-06-14.
    These data include CURRENT SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH
    COMPONENT (V). The instruments used to collect these data include ADCP and GPS.
    These data were collected by Chris Goldfinger of Oregon State University; College
    of Earth, Ocean, and Atmospheric Sciences, and by University of California - San
    Diego; Scripps Institution of Oceanography as part of The Mw 9.3 Indonesian Earthquake
    and the Holocene Great Earthquake Record from the Northern Sumatran Subduction Zone.
    The Lamont-Doherty Earth Observatory (LDEO) submitted these data to NCEI as part
    of the NSF sponsored Rolling Deck to Repository (R2R) program.nnThe ADCP data represent
    the raw and automated processed data set. Post processed quality assessed data are
